measurements.description:
One striking flower on one staked 23.0-cm upright inflorescence; 
	dorsal sepal apiculate, cream heavily overlaid burgundy, veined black-burgundy;
    synsepal burgundy, striated saturated-burgundy;	

	petals ciliate, cream, proximally blushed green, heavily overlaid burgundy distally and on upper margins; 
	pouch downy, black-burgundy; 
    staminode cream, suffused rose apically, burgundy distally;
	substance firm; texture glossy.
